Frankrijk
Avontuur / Thriller
108 minuten

goed

met Tomer Sisley, Kristin Scott Thomas en Karel Roden

Als ontdekt wordt dat aandeelhouder Nerio Winch vermoord is, moeten er vele vragen beantwoord worden. Wie zal zijn grote vermogen 
erven? Hij had geen familie en toch leidt alles ertoe dat de erfenis de reden is van zijn dood. Niemand had echter gerekend op 
het grote geheim van Nerio: een geadopteerde zoon die zijn tijd doorbrengt in een Bosnisch weeshuis, een zekere Largo Winch. 
Largo beweert dat hij onschuldig is.
